import React from 'react';
import styles from './App.module.scss';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import Header from './components/header/Header';
import Footer from './components/footer/Footer';
import Home from './pages/home/Home';
import Login from './pages/login/Login';
import Registration from './pages/registration/Registration';
import TestPage from './pages/testPage/TestPage';
import ResultPage from './pages/resultPage/ResultPage';
import TestForm from './pages/testForm/TestForm';
import { isLoggedIn } from './services/authService';
import UserTests from './components/userTests/UserTests';


function App() {

  return (
    <BrowserRouter>
      <Header />
      <Routes>
        <Route path='/' index element={<Home />} />
        <Route path='auth/login' element={isLoggedIn() ? <Navigate replace to='/' /> : <Login />} />
        <Route path='auth/registration' element={isLoggedIn() ? <Navigate replace to='/' /> : <Registration />} />
        <Route path='test/:id' element={<TestPage />} />
        <Route path='test/:id/result' element={<ResultPage />} />
        <Route path='test/create' element={<TestForm />} />
        <Route path='user/myPosts' element={<UserTests />} />
      </Routes>
      <Footer />
    </BrowserRouter>
  );
}

export default App;
